package com.smappinc.vpnmaster.pro.Model;import java.util.ArrayList;public class Parent_Server_Adapter {	private String host_Name;	private String serverIp;	private String selectedCity,ovpn_config,ikev2_config,username,password,type;	public ArrayList<Cities_Server_List_Pojo> citiesList;	public Parent_Server_Adapter(){		citiesList = new ArrayList<>();	}	public String getServerIp() {		return serverIp;	}	public void setServerIp(String serverIp) {		this.serverIp = serverIp;	}	public String getType() {		return type;	}	public void setType(String type) {		this.type = type;	}	public String getUsername() {		return username;	}	public void setUsername(String username) {		this.username = username;	}	public String getPassword() {		return password;	}	public void setPassword(String password) {		this.password = password;	}	public String getOvpn_config() {		return ovpn_config;	}	public void setOvpn_config(String ovpn_config) {		this.ovpn_config = ovpn_config;	}	public String getIkev2_config() {		return ikev2_config;	}	public void setIkev2_config(String ikev2_config) {		this.ikev2_config = ikev2_config;	}	public String getHost_Name() {		return host_Name;	}	public void setHost_Name(String host_Name) {		this.host_Name = host_Name;	}	public String getSelectedCity() {		return selectedCity;	}	public void setSelectedCity(String selectedCity) {		this.selectedCity = selectedCity;	}	@Override	public String toString() {		return "Parent_Server_Adapter{" +				"host_Name='" + host_Name + '\'' +				", serverIp='" + serverIp + '\'' +				", selectedCity='" + selectedCity + '\'' +				", ovpn_config='" + ovpn_config + '\'' +				", ikev2_config='" + ikev2_config + '\'' +				", username='" + username + '\'' +				", password='" + password + '\'' +				", type='" + type + '\'' +				", citiesList=" + citiesList +				'}';	}}